import React from "react";
import ReactDOM from "react-dom";
import Submit from "../Submit/Submit"
import axios from "axios";
var inputStyle = {
  "border-radius": "15px",
  width: "300px",
  marginTop: "25px",
  height: "30px",
  "text-align": "center",
  marginLeft: "15%",
  "background-color": "lightblue"
};
var containerStyle = {
  "border-radius": "20px",
  width: "40%",
  left: "25%",
  top: "10%",
  position: "absolute",
  "text-align": "center",
  padding: "20px",
  "background-color": "tomato"
};
var headStyle = {
  "font-size": "25px",
  border: "3px solid black",
  height: "30px",
  "text-align": "center",
  "background-color": "aqua"
};
class Register extends React.Component {
  constructor()
  {
    super();
    this.state = {
      data : null,
      isDataLoaded : false,
      username : "",
      password : "",
      confirmareparola : "",
      nr_telefon : "",
      link_poza : "",
      email : "",
    }
  }
  loadData = () => {
    axios.get("http://localhost:3005/users")
    .then(req => {
      this.setState({
        isDataLoaded : true,
        data : req.data
      })
    })
  }
  componentDidMount(){
    this.loadData();
    this.setState({
      timer : setInterval(this.loadData,500)
    })
  }
  componentWillUnmount() {
    clearInterval(this.state.timer);
  }
  uploadData = (e) => {
    this.setState({
      [e.target.id] : e.target.value
    });
  }
  
  newRegister = () => {
     var a = true;
    if(this.state.username === ""  || this.state.password === "" || this.state.confirmareparola === "" || this.state.nr_telefon ==='' || this.state.link_poza ==="" || this.state.email === "")
    {alert("Unul dintre campuri este gol");
    this.a = false;
}
else if(this.state.username === undefined  || this.state.password === undefined || this.state.confirmareparola === undefined || this.state.nr_telefon ==='' || this.state.link_poza ===undefined || this.state.email === undefined)
{
    alert("Nu ai introdus corect datele intr-unul din campuri!");
    this.a = false;
}
else {
  axios.post("http://localhost:3005/register", {
    username : this.state.username,
    password : this.state.password,
    confirmareparola : this.state.confirmareparola,
    nr_telefon : this.state.nr_telefon,
    link_poza : this.state.link_poza,
    email : this.state.email
  })
  .then(res => {
    this.loadData();
    if(res.data === "Succes")
    this.setState({
      dataOk : true
    })
    else if(res.data === "Parola diferita")
    alert("Te rugam introdu aceeasi parola!");
  })
  .catch(err => {
    alert("Eroare de la server");
    this.a = false;
  })
}

  }

  render() {
    if(this.state.dataOk)
  return (
    <Submit/>
  )
    return (
      <div style={headStyle}>
        <div>Pagina de inregistrare</div>
        <div style={containerStyle}>
          <input onChange = {this.uploadData} id = "username" style={inputStyle} placeholder="Username" />
          <br />
          
          <input onChange = {this.uploadData} id = "password" style={inputStyle} placeholder="Parola" />
          <br />
          <input  onChange = {this.uploadData} id = "confirmareparola" style={inputStyle} placeholder="Confirmare parola" />
          <br />
          <input onChange = {this.uploadData} id = "nr_telefon" style={inputStyle} placeholder="Numar de telefon" />
          <br />
          <input onChange = {this.uploadData} id = "link_poza" style={inputStyle} placeholder="link pentru poza" />
          <br />
          <input onChange = {this.uploadData} id = "email" style={inputStyle} placeholder="email" />
          <br />
          <button id = "register" onClick = {this.newRegister}>Inregistrare</button>
        </div>
        <div />
      </div>
    )
    
  }
}


export default Register;
